const TicketList = ({ tickets }) => {
    // Format date
    const formatDate = (dateString) => {
      const options = { year: "numeric", month: "short", day: "numeric", hour: "2-digit", minute: "2-digit" }
      return new Date(dateString).toLocaleDateString(undefined, options)
    }

    // Get status badge style
    const getStatusStyle = (status) => {
      switch (status) {
        case "OPEN":
          return {
            bg: "bg-blue-50 dark:bg-blue-900/30",
            text: "text-blue-700 dark:text-blue-300",
            icon: "border-blue-400 dark:border-blue-500",
          }
        case "IN_PROGRESS":
          return {
            bg: "bg-yellow-50 dark:bg-yellow-900/30",
            text: "text-yellow-700 dark:text-yellow-300",
            icon: "border-yellow-400 dark:border-yellow-500",
          }
        case "CLOSED":
          return {
            bg: "bg-green-50 dark:bg-green-900/30",
            text: "text-green-700 dark:text-green-300",
            icon: "border-green-400 dark:border-green-500",
          }
        default:
          return {
            bg: "bg-gray-50 dark:bg-gray-900/30",
            text: "text-gray-700 dark:text-gray-300",
            icon: "border-gray-400 dark:border-gray-500",
          }
      }
    }

    if (tickets.length === 0) {
      return (
        <div className="flex h-[300px] items-center justify-center rounded-lg border-2 border-dashed border-gray-200 dark:border-gray-700">
          <div className="text-center">
            <div className="mx-auto mb-4 h-12 w-12 rounded-full bg-gray-100 p-3 dark:bg-gray-800">
              <svg
                xmlns="http://www.w3.org/2000/svg"
                className="h-full w-full text-gray-400"
                fill="none"
                viewBox="0 0 24 24"
                stroke="currentColor"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth={2}
                  d="M7 8h10M7 12h4m1 8l-4-4H5a2 2 0 01-2-2V6a2 2 0 012-2h14a2 2 0 012 2v8a2 2 0 01-2 2h-3l-4 4z"
                />
              </svg>
            </div>
            <h3 className="mb-1 text-lg font-medium text-gray-900 dark:text-white">No tickets found</h3>
            <p className="text-sm text-gray-500 dark:text-gray-400">Create a new ticket to get started.</p>
          </div>
        </div>
      )
    }

    return (
      <div className="space-y-4">
        {tickets.map((ticket) => {
          const statusStyle = getStatusStyle(ticket.status)
          return (
            <div
              key={ticket._id}
              className="card-hover overflow-hidden rounded-lg border border-gray-200 bg-white shadow-soft transition-all dark:border-gray-700 dark:bg-gray-800"
            >
              <div className="border-b border-gray-100 bg-gray-50 px-4 py-3 dark:border-gray-700 dark:bg-gray-800/50">
                <div className="flex items-center justify-between">
                  <h3 className="text-lg font-medium text-gray-900 dark:text-white">{ticket.title}</h3>
                  <div className={`flex items-center gap-2 rounded-full px-3 py-1 ${statusStyle.bg}`}>
                    <span className={`h-2 w-2 rounded-full border ${statusStyle.icon}`}></span>
                    <span className={`text-xs font-medium ${statusStyle.text}`}>{ticket.status.replace("_", " ")}</span>
                  </div>
                </div>
                <p className="mt-1 text-sm text-gray-500 dark:text-gray-400">Created on {formatDate(ticket.createdAt)}</p>
              </div>
              <div className="p-4">
                <p className="text-sm text-gray-700 dark:text-gray-300">{ticket.description}</p>
              </div>
              <div className="border-t border-gray-100 bg-gray-50 px-4 py-2 dark:border-gray-700 dark:bg-gray-800/50">
                <p className="text-xs text-gray-500 dark:text-gray-400">Ticket ID: {ticket._id}</p>
              </div>
            </div>
          )
        })}
      </div>
    )
  }

  export default TicketList
